import React from 'react';
import logo from './logo.svg';
import './App.css';
import {Button, Form, FormGroup, Label, Input } from 'reactstrap';

function Login() {
  return (
    <div className="login-body">
    <div className="top-nav">
    </div>
    <div>
    <Form className="login-form">
      <h1 id="header">تسجيل دخول</h1>
      <FormGroup>
        <Label>اسم المستخدم</Label>
        <Input type="username"></Input>
      </FormGroup>
      <FormGroup>
        <Label>كلمة المرور</Label>
        <Input type="password"></Input>
      </FormGroup>
      <Label for="select" style={{marign:20}}> شئون الطلبة</Label>
      <Input style={{marign:20}} id="radio" type="radio" name="select" value="secretary">
      </Input>
      <Label for="select" style={{marign:20}}>طالب</Label>
      <Input style={{marign:20, padding:20}} id="radio" type="radio" name="select" value="student">
      </Input>
      <Button className="btn-lg btn-blue btn-block">الدخول</Button>
    </Form>
    </div>
    </div>
  );
}

export default Login;
